import styles from "./HomePage.module.css"
import {ICake} from "../../assets/types/cake.interface";


interface CarItemProps {
    cake: ICake; // Явно указываем тип параметра car
}
function CakeItem({cake}:CarItemProps){
    return(
        <div key={cake.id} className={styles.item}>
            <div style={{backgroundImage: `url(${cake.image})`}} />
            <div>
                <h2>{cake.name}</h2>
                <p>{new Intl.NumberFormat(
                    'ru-US',{
                        style: 'currency',
                        currency: 'RUB',
                    }).format(cake.price)}
                </p>
            </div>
        </div>
    )
}
export default CakeItem
